func transposeMatrix(matrix *mat.Dense) *mat.Dense {
	// Get the number of rows and columns in the original matrix
	numRows, numCols := matrix.Dims()

	// Create a new matrix to store the transposed values
	transposed := mat.NewDense(numCols, numRows, nil)

	// Transpose the matrix
	transposed.Copy(matrix.T())

	return transposed
}

func toMatrix(v []float64, m, n int) *mat.Dense {
	dense := mat.NewDense(m, n, nil)

	for i := 0; i < m; i++ {
		for j := 0; j < n; j++ {
			dense.Set(i, j, v[i+j*m])
		}
	}

	return dense
}

func toVector(matrix *mat.Dense) []float64 {
	m, n := matrix.Dims()

	vector := make([]float64, m*n)
	for j := 0; j < n; j++ {
		for i := 0; i < m; i++ {
			vector[j*m+i] = matrix.At(i, j)
		}
	}

	return vector
}
