func rotateVector(vector []float64, t int) []float64 {
	n := len(vector)

	if t <= 0 || n <= 1 {
		return vector // No rotation needed
	}

	// Calculate the effective rotation amount modulo the vector length
	t = t % n

	// Create a new slice for the rotated vector
	rotated := make([]float64, n)

	// Copy the rotated elements to the new slice
	copy(rotated, vector[t:])
	copy(rotated[n-t:], vector[:t])

	return rotated
}

func extendVector(vector, extensionVector []float64) ([]float64, error) {
	len1 := len(vector)
	len2 := len(extensionVector)

	if len2 == 0 {
		return nil, fmt.Errorf("Extension vector is empty")
	}

	// Calculate the number of times extensionVector should be repeated
	repeat := len1 / len2

	// Initialize the extended vector
	extended := make([]float64, len1)

	// Extend the extensionVector to the target vector
	for i := 0; i < len2; i++ {
		for j := 0; j < repeat; j++ {
			extended[j+i*repeat] = extensionVector[i]
		}
	}

	return extended, nil
}

// add performs element-wise addition of two vectors.
// It returns a new vector with the result of the addition.
func Vectoradd(vector1, vector2 []float64) []float64 {
	len1 := len(vector1)
	len2 := len(vector2)

	// Determine the smaller length
	minLen := len1
	if len2 < minLen {
		minLen = len2
	}

	result := make([]float64, minLen)

	for i := 0; i < minLen; i++ {
		result[i] = vector1[i] + vector2[i]
	}

	return result
}

func addInGroups(slice []float64, n int) ([]float64, error) {
	length := len(slice)

	if n <= 0 || length == 0 {
		return nil, fmt.Errorf("Invalid input")
	}

	// Calculate the number of groups
	numGroups := (length + n - 1) / n
	// Initialize the result slice
	result := make([]float64, n)

	for i := 0; i < numGroups; i++ {
		result = Vectoradd(slice[n*i:n*i+n], result)
	}

	return result, nil
}

// mul performs element-wise multiplication of two vectors.
// It returns a new vector with the result of the multiplication.
func mul(vector1, vector2 []float64) ([]float64, error) {
	len1 := len(vector1)
	len2 := len(vector2)

	if len1 != len2 {
		return nil, fmt.Errorf("vector lengths are not equal: %d and %d", len1, len2)
	}

	result := make([]float64, len1)

	for i := 0; i < len1; i++ {
		result[i] = vector1[i] * vector2[i]
	}

	return result, nil
}

func getColumnAsFloat64(matrix *mat.Dense, columnIndex int) []float64 {
	rows, cols := matrix.Dims()
	if columnIndex < 0 || columnIndex >= cols {
		// Handle invalid input or out-of-range column index
		return nil
	}

	column := make([]float64, rows)

	for i := 0; i < rows; i++ {
		column[i] = matrix.At(i, columnIndex)
	}

	return column
}

func productInVectorFrom(matrix1, matrix2 *mat.Dense) ([]float64, error) {

	rows1, cols1 := matrix1.Dims()
	rows2, cols2 := matrix2.Dims()

	if cols1 != rows2 && cols2 != rows1 {
		return nil, errors.New("Matrix dimensions are not compatible for multiplication")
	}

	vector1 := toVector(matrix1)

	len1 := len(vector1)

	if rows2 <= 0 || len1 <= 0 {
		return nil, fmt.Errorf("Invalid input: rows2=%d, len(vector1)=%d", rows2, len1)
	}

	// Initialize the result vector with 0s
	multiplier := make([]float64, len1)

	// Set the first 'rows2' entries to 1
	for i := 0; i < rows1 && i < len1; i++ {
		multiplier[i] = 1
	}
	//fmt.Println(multiplier)

	result := make([]float64, rows1*cols2)

	for i := 0; i < cols2; i++ {

		colVec := getColumnAsFloat64(matrix2, i)
		colVec, _ = extendVector(vector1, colVec)
		for j := 0; j < rows2; j++ {
			resultAddendum, _ := mul(colVec, vector1)
			resultAddendum, _ = mul(resultAddendum, multiplier)
			result = Vectoradd(result, resultAddendum)
			vector1 = rotateVector(vector1, rows1)
			colVec = rotateVector(colVec, rows1)
		}

		result = rotateVector(result, rows1)

	}
	resultMatrix := toMatrix(result, rows1, cols2)
	fmt.Printf("Matrix A*B in vector form:\n%v\n", mat.Formatted(resultMatrix, mat.Prefix(""), mat.Squeeze()))
	return result, nil
}

func productInVectorFromEncrypted(evaluator ckks.Evaluator, encoder ckks.Encoder, encryptor rlwe.Encryptor, decryptor rlwe.Decryptor, params ckks.Parameters, matrix1, matrix2 *mat.Dense) (*mat.Dense, error) {

	rows1, cols1 := matrix1.Dims()
	rows2, cols2 := matrix2.Dims()

	if cols1 != rows2 && cols2 != rows1 {
		return nil, errors.New("Matrix dimensions are not compatible for multiplication")
	}

	vector1 := toVector(matrix1) //vector form of matrix1

	len1 := len(vector1)

	if rows2 <= 0 || len1 <= 0 {
		return nil, fmt.Errorf("Invalid input: rows2=%d, len(vector1)=%d", rows2, len1)
	}

	// Initialize the result vector with 0s
	multiplier := make([]float64, len1)

	// Set the first 'rows2' entries to 1
	for i := 0; i < rows1 && i < len1; i++ {
		multiplier[i] = 1
	}
	//fmt.Println(multiplier)

	result := make([]float64, rows1*cols2)

	encodedVector1 := encoder.EncodeNew(vector1, params.MaxLevel(), params.DefaultScale(), params.LogSlots())
	encodedMultiplier := encoder.EncodeNew(multiplier, params.MaxLevel(), params.DefaultScale(), params.LogSlots())
	encodedResult := encoder.EncodeNew(result, params.MaxLevel(), params.DefaultScale(), params.LogSlots())

	encryptedVector1 := encryptor.EncryptNew(encodedVector1)
	encryptedResult := encryptor.EncryptNew(encodedResult)

	for i := 0; i < cols2; i++ {

		colVec := getColumnAsFloat64(matrix2, i)
		colVec, _ = extendVector(vector1, colVec)

		encodedColVec := encoder.EncodeNew(colVec, params.MaxLevel(), params.DefaultScale(), params.LogSlots()) // fixme
		encryptedColVec := encryptor.EncryptNew(encodedColVec)
		for j := 0; j < rows2; j++ {

			//resultAddendum, _ := mul(colVec, vector1)
			resultAddendum := evaluator.MulNew(encryptedVector1, encryptedColVec)

			//resultAddendum, _ = mul(resultAddendum, multiplier)
			resultAddendum = evaluator.MulNew(resultAddendum, encodedMultiplier)

			//result = add(result, resultAddendum)
			encryptedResult = evaluator.AddNew(encryptedResult, resultAddendum)

			//vector1 = rotateVector(vector1, rows1)
			encryptedVector1 = evaluator.RotateNew(encryptedVector1, rows1)

			//colVec = rotateVector(colVec, rows1)
			encryptedColVec = evaluator.RotateNew(encryptedColVec, rows1)
		}

		//result = rotateVector(result, rows1)
		evaluator.Rotate(encryptedResult, rows1, encryptedResult)

	}

	decryptedResult := decryptor.DecryptNew(encryptedResult)
	decodedResult := encoder.Decode(decryptedResult, params.LogSlots())

	resultFloat := make([]float64, len(decodedResult))
	for i, val := range decodedResult {
		resultFloat[i] = real(val)
	}

	resultMatrix := toMatrix(resultFloat, rows1, cols2)
	fmt.Printf("Matrix A*B in vector form:\n%v\n", mat.Formatted(resultMatrix, mat.Prefix(""), mat.Squeeze()))
	return resultMatrix, nil
}

func repeatVector(vector, repetitionVector []float64) ([]float64, error) {
	len1 := len(vector)
	len2 := len(repetitionVector)

	if len2 == 0 {
		return nil, fmt.Errorf("Repetition vector is empty")
	}

	// Calculate the number of times repetitionVector should be repeated
	repeat := len1 / len2

	// Initialize the repeated vector
	repeated := make([]float64, len1)

	// Repeat the repetitionVector to the target vector
	for i := 0; i < repeat; i++ {
		for j := 0; j < len2; j++ {
			repeated[i*len2+j] = repetitionVector[j]
		}
	}

	return repeated, nil
}

func OneLevelScalar(evaluator ckks.Evaluator, encoder ckks.Encoder, encryptor rlwe.Encryptor, decryptor rlwe.Decryptor, params ckks.Parameters, matrix1, matrix2 *mat.Dense) []float64 {
	rowNumMatrix, colNumMatrix := matrix1.Dims()
	//colNumVector, rowNumVector := matrix2.Dims()
	//initialSize, _ := matrix2.Dims()

	vector1 := toVector(matrix1)
	vector2 := toVector(matrix2)
	vector2, _ = extendVector(vector1, vector2)
	encodedVector1 := encoder.EncodeNew(vector1, params.MaxLevel(), params.DefaultScale(), params.LogSlots())
	encodedVector2 := encoder.EncodeNew(vector2, params.MaxLevel(), params.DefaultScale(), params.LogSlots())
	encryptedVector1 := encryptor.EncryptNew(encodedVector1)
	evaluator.Mul(encryptedVector1, encodedVector2, encryptedVector1)
	initialEncrypted := encryptedVector1.CopyNew()
	for i := 1; i < colNumMatrix; i++ {
		rotatedVector := evaluator.RotateNew(initialEncrypted, rowNumMatrix*i)
		evaluator.Add(encryptedVector1, rotatedVector, encryptedVector1)
	}

	decryptedVector1 := decryptor.DecryptNew(encryptedVector1)
	decodedVector1 := encoder.Decode(decryptedVector1, params.LogSlots())

	resultFloat := make([]float64, len(decodedVector1))
	for i, val := range decodedVector1 {
		resultFloat[i] = real(val)
	}

	return resultFloat[:rowNumMatrix]
}

